package common

import (
	"testing"

	"github.com/stretchr/testify/require"
)

func TestEnum_UTM_DATA_AVAIL_FLAGS(t *testing.T) {
	t.Run("zero", func(t *testing.T) {
		var e UTM_DATA_AVAIL_FLAGS
		e.UnmarshalText([]byte{})
		e.MarshalText()
		e.String()
	})

	t.Run("first entry", func(t *testing.T) {
		enc, err := UTM_DATA_AVAIL_FLAGS_TIME_VALID.MarshalText()
		require.NoError(t, err)

		var dec UTM_DATA_AVAIL_FLAGS
		err = dec.UnmarshalText(enc)
		require.NoError(t, err)

		require.Equal(t, UTM_DATA_AVAIL_FLAGS_TIME_VALID, dec)
	})
}
